import React from 'react'
import productos from '../produtos.json'
import Card from '../components/card'

function Listado(){
    return (
        <div className = "container">
            
            <div className = "row">
                {productos.map((datos)=>{
                    return <Card data = {datos} />
                })}                
            </div>

        </div>

    )
}

export default Listado
